import React, { useState } from "react";
import CarCard from "./CarCard";

const cars = [
  {
    id: 1,
    brand: "Toyota",
    model: "Corolla",
    year: 2020,
    type: "Sedan",
    image: "data:image/jpeg;base64,",
  },
  {
    id: 2,
    brand: "Ford",
    model: "Ranger",
    year: 2022,
    type: "Truck",
    image: "data:image/jpeg;base64,",
  },
  {
    id: 3,
    brand: "Honda",
    model: "Civic",
    year: 2021,
    type: "Sedan",
    image: "data:image/jpeg;base64,"
  },
];

function CarList() {
  const [formVisible, setFormVisible] = useState(null); // Track which car form is visible

  const toggleFormVisibility = (id) => {
    setFormVisible(formVisible === id ? null : id); // Toggle form visibility for a specific car
  };

  return (
    <div className="car-list">
      <h2 className="text-2xl font-bold mb-6">Available Cars for Hire</h2>
      <div className="car-grid grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-8">
        {cars.map((car) => (
          <div key={car.id} className="car-card bg-white p-6 rounded-lg shadow-md">
            <CarCard car={car} />
            <button
              onClick={() => toggleFormVisibility(car.id)}
              className="book-now-btn bg-blue-500 text-white py-2 px-4 mt-4 rounded-full w-full"
            >
              Book Now
            </button>

            {formVisible === car.id && (
              <div className="book-form mt-4">
                <form className="bg-gray-100 p-4 rounded-lg shadow-sm">
                  <h3 className="text-lg font-semibold mb-4">Booking Form</h3>
                  <div className="form-group mb-4">
                    <label htmlFor="name" className="block text-sm">Full Name</label>
                    <input
                      type="text"
                      id="name"
                      className="w-full p-2 border rounded"
                      placeholder="Enter your name"
                    />
                  </div>
                  <div className="form-group mb-4">
                    <label htmlFor="email" className="block text-sm">Email</label>
                    <input
                      type="email"
                      id="email"
                      className="w-full p-2 border rounded"
                      placeholder="Enter your email"
                    />
                  </div>
                  <div className="form-group mb-4">
                    <label htmlFor="pickup-date" className="block text-sm">Pick-up Date</label>
                    <input
                      type="date"
                      id="pickup-date"
                      className="w-full p-2 border rounded"
                    />
                  </div>
                  <button
                    type="submit"
                    className="submit-btn bg-green-500 text-white py-2 px-4 mt-4 rounded-full w-full"
                  >
                    Confirm Booking
                  </button>
                </form>
              </div>
            )}
          </div>
        ))}
      </div>
    </div>
  );
}

export default CarList;
